import { Link } from "react-router-dom";
import { Fragment } from "react/cjs/react.production.min";

const MainHeader = () => {
  return (
    <Fragment>
      <header>
        <Link to="/welcome">Welcome</Link>
        <Link to="/products">Products</Link>
      </header>
    </Fragment>
  );
};

export default MainHeader;
